tables.table_schema:
CREATE TABLE public_facilities (
    facility_id SERIAL PRIMARY KEY,
    facility_name VARCHAR(255),
    location VARCHAR(255),
    usage_category VARCHAR(50)
);

CREATE TABLE facility_usage (
    usage_id SERIAL PRIMARY KEY,
    facility_id INT REFERENCES public_facilities(facility_id),
    usage_date DATE,
    usage_duration INTERVAL,
    user_id INT
);

CREATE TABLE public_facilities (
 facility_id INT PRIMARY KEY,
 facility_name VARCHAR(100),
 location VARCHAR(255),
 usage_count INT
);

CREATE TABLE facility_types (
 type_id INT PRIMARY KEY,
 type_name VARCHAR(100)
);

CREATE TABLE facility_users (
 user_id INT PRIMARY KEY,
 user_name VARCHAR(100),
 user_contact VARCHAR(20)
);

CREATE TABLE facilities (
  facility_id INT PRIMARY KEY,
 facility_name VARCHAR(255),
 location_id INT,
 usage_type VARCHAR(100)
);

CREATE TABLE locations (
  location_id INT PRIMARY KEY,
 location_name VARCHAR(255),
 city VARCHAR(100),
 country VARCHAR(100)
);

CREATE TABLE usage_logs (
  log_id INT PRIMARY KEY,
 facility_id INT,
 user_id INT,
 usage_date DATE
);

CREATE TABLE users (
  user_id INT PRIMARY KEY,
 user_name VARCHAR(255),
 email VARCHAR(255),
 phone_number VARCHAR(20)
);

CREATE TABLE cities (
  city_id INT PRIMARY KEY,
 city_name VARCHAR(255),
 population INT,
 area_sqkm DECIMAL(10, 2)
);
